  `HR_VILLAGE_NO_1` varchar(50) DEFAULT '',
  `HR_VILLAGE_NO_2` varchar(50) DEFAULT '',
  `HR_VILLAGE_NAME_1` varchar(50) DEFAULT '',
  `HR_VILLAGE_NAME_2` varchar(50) DEFAULT '',
  `PROVINCE_ID_1` varchar(10) DEFAULT '',
  `PROVINCE_ID_2` varchar(10) DEFAULT '',
  `AMPHUR_ID_1` varchar(10) DEFAULT '',
  `AMPHUR_ID_2` varchar(10) DEFAULT '',
  `TUMBON_ID_1` varchar(10) DEFAULT '',
  `TUMBON_ID_2` varchar(10) DEFAULT '',
  `HR_ZIPCODE_1` varchar(5) DEFAULT '',
  `HR_ZIPCODE_2` varchar(5) DEFAULT '',
  `HR_HOME_PHONE_1` varchar(30) DEFAULT '',
  `HR_HOME_PHONE_2` varchar(30) DEFAULT '',
