  `HR_BANK_OT_ID` varchar(10) DEFAULT '',
  `BOOK_BANK_OT` varchar(20) DEFAULT '',
  `BOOK_BANK_OT_BRANCH` varchar(50) DEFAULT '',
  `MARRY_CID` varchar(13) DEFAULT '',
  `MARRY_NAME` varchar(50) DEFAULT '',
  `HR_DEPARTMENT_SUB_SUB_ID` varchar(10) DEFAULT '',
  `HOS_USE_CODE` varchar(20) DEFAULT '',
