  `HR_FG3` longblob DEFAULT NULL,
  `HR_FG4` longblob DEFAULT NULL,
  `HR_FG5` longblob DEFAULT NULL,
  `LAT` decimal(18,12) DEFAULT NULL,
  `LNG` decimal(18,12) DEFAULT NULL,
  `TAX_DEDUCTIONS` decimal(10,2) DEFAULT NULL COMMENT 'เปอร์เซนต์หักภาษี ณ ที่จ่ายรายบุคคลรายรายการ',
  `TAX_NUM` varchar(15) DEFAULT NULL,
  `MONEY_GROUP_ID` int(10) DEFAULT NULL,
  `APP_TYPE_SAVE` varchar(10) DEFAULT NULL COMMENT 'WIN WEB MOB',
