  UNIQUE KEY `ix_id` (`ID`),
  KEY `ix_name_cid` (`HR_CID`,`HR_FNAME`,`HR_LNAME`),
  KEY `HR_PREFIX_ID` (`HR_PREFIX_ID`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=333 DEFAULT CHARSET=tis620 COMMENT='ข้อมูลบุคลากร';

